// src/pages/Dashboard.js
import React, { useEffect, useState } from 'react';
import { getAuth } from 'firebase/auth';
import { getFirestore, doc, getDoc } from 'firebase/firestore';
import { Card, CardContent } from '../components/ui/card';
import { Button } from '../components/ui/button';
import { Link } from 'react-router-dom';
import dogImage from '../assets/base-dog.jpg'; // Use placeholder or update with your avatar

const Dashboard = () => {
  const [dogbone, setDogbone] = useState(0);
  const [loginStreak, setLoginStreak] = useState(0);
  const [equippedCollar, setEquippedCollar] = useState('');
  const auth = getAuth();
  const db = getFirestore();

  useEffect(() => {
    const fetchUserData = async () => {
      const user = auth.currentUser;
      if (!user) return;

      try {
        const userRef = doc(db, 'users', user.uid);
        const userSnap = await getDoc(userRef);

        if (userSnap.exists()) {
          const data = userSnap.data();
          setDogbone(data.dogbone || 0);
          setLoginStreak(data.loginStreak || 0);
          setEquippedCollar(data.equippedCollar || '');
        }
      } catch (err) {
        console.error('Error loading dashboard:', err);
      }
    };

    fetchUserData();
  }, [auth, db]);

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <div className="max-w-6xl mx-auto">

        {/* Header */}
        <div className="flex items-center justify-between mb-6">
          <div>
            <h1 className="text-3xl font-bold">Your Dashboard</h1>
            <p className="text-gray-600">Welcome back to Inplay Dogs</p>
          </div>
          <div className="text-right">
            <p className="text-lg font-semibold">DOGBONE: {dogbone}</p>
            <p className="text-sm text-gray-500">Login Streak: {loginStreak} days</p>
          </div>
        </div>

        {/* Panels Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">

          {/* Watchdog Panel */}
          <Card>
            <CardContent className="p-4">
              <h2 className="text-xl font-semibold mb-2">Your Watchdog</h2>
              <img src={dogImage} alt="Your Watchdog" className="w-32 h-32 rounded-full mb-4 mx-auto" />
              <p>Equipped Collar: <span className="capitalize font-semibold">{equippedCollar || 'None'}</span></p>
              <p>Alerts Created: 12</p>
              <p>DogSignal Accuracy: 76%</p>
            </CardContent>
          </Card>

          {/* Gear Panel */}
          <Card>
            <CardContent className="p-4">
              <h2 className="text-xl font-semibold mb-2">Equipped Gear</h2>
              <ul className="text-sm text-gray-700 space-y-1">
                <li>Head: Bone Helmet</li>
                <li>Collar: {equippedCollar || 'None'}</li>
                <li>Eyes: Laser Visor</li>
                <li>Body: Hoodie</li>
              </ul>
              <Link to="/doghouse">
                <Button className="mt-4 w-full">Open Dog House</Button>
              </Link>
            </CardContent>
          </Card>

          {/* DOGBONE Panel */}
          <Card>
            <CardContent className="p-4">
              <h2 className="text-xl font-semibold mb-2">DOGBONE Balance</h2>
              <p className="text-2xl font-bold text-green-600">{dogbone}</p>
              <p className="text-gray-500 text-sm">Earned this week: 150</p>
              <Link to="/shop">
                <Button className="mt-4 w-full">Visit Dog Shop</Button>
              </Link>
            </CardContent>
          </Card>

          {/* Arcade Panel */}
          <Card>
            <CardContent className="p-4">
              <h2 className="text-xl font-semibold mb-2">DOGBONE Arcade</h2>
              <p>Dig Yard Score: 4,200</p>
              <p>Fetch Frenzy Score: 3,750</p>
              <Link to="/arcade">
                <Button className="mt-4 w-full">Enter Arcade</Button>
              </Link>
            </CardContent>
          </Card>

          {/* Leaderboard Panel */}
          <Card>
            <CardContent className="p-4">
              <h2 className="text-xl font-semibold mb-2">Contests & Rankings</h2>
              <p>Active Contest: Predict 3/3 outcomes</p>
              <p>Leaderboard Rank: #27</p>
              <Button className="mt-4 w-full">View Leaderboard</Button>
            </CardContent>
          </Card>

        </div>
      </div>
    </div>
  );
};

export default Dashboard;
